def generateBST(n):
    if n == 0:
        return [None]
    res = []
    for i in range(1, n+1):
        for node in generateBST(i-1):
            left = [node]
            right = generateBST(n-i-1)
            for r in right:
                left.append(r)
            res.append(left)
    return res
